// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract TokenSale {
    address public owner;
    IERC20 public token;
    uint256 public rate = 1000; // 1 ETH = 1000 tokens

    event TokensPurchased(address indexed buyer, uint256 amount);
    event Withdrawn(address indexed to, uint256 amount);

    constructor(address _tokenAddress) {
        owner = msg.sender;
        token = IERC20(_tokenAddress);
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Not owner");
        _;
    }

    // Buy tokens by sending ETH
    function buyTokens() public payable {
        require(msg.value > 0, "Send ETH to buy tokens");

        uint256 tokensToBuy = msg.value * rate;
        uint256 contractBalance = token.balanceOf(address(this));
        require(contractBalance >= tokensToBuy, "Not enough tokens in contract");

        token.transfer(msg.sender, tokensToBuy);

        emit TokensPurchased(msg.sender, tokensToBuy);
    }

    // Withdraw ETH from contract
    function withdrawFunds(address payable _to) public onlyOwner {
        uint256 balance = address(this).balance;
        require(balance > 0, "No ETH to withdraw");
        _to.transfer(balance);

        emit Withdrawn(_to, balance);
    }

    // Check ETH balance
    function getContractETHBalance() public view returns (uint256) {
        return address(this).balance;
    }

    // Check token balance
    function getTokenBalance() public view returns (uint256) {
        return token.balanceOf(address(this));
    }
}

